    const handleClick = onSelct ? () => onSelct(rating) : undefined;
    return <span className={className}>*</span>;
}

function Rating({ value = 0, onSelect }) {
    return (
        <div>
            {RATINGS.map((rating) => (
                <Star
                    key={rating}
                    selected={value >= rating}
                    rating={rating}
                    onSelect={onSelect}
                ></Star>
            ))}
        </div>
    );
}

